</script><style type="text/css">table{border-spacing:1px;border-collapse:separate}td.cell{height:30px;width:30px;display:table-cell;text-align:center;line-height:0}span.hint{display:inline-block;height:8px;width:8px;border-radius:6px;border:2px solid white;opacity:0.1}span.hint.strong{opacity:0.5}span.hint.strong.current{opacity:1}.hint1{background-color:blue}.hint2{background-color:green}.hint3{background-color:red}.hint4{background-color:yellow}td.m-2,td.m-water,td.m-waterhorizontal,td.m-watercorner3,td.m-watercorner2,td.m-watercorner1,td.m-watercross,td.m-watertripleright,td.m-watervertical{background:#497E90}td.m-{background:#8ABA32}td.m-r{background:#9F9F9A}td.m-red,td.m-green,td.m-yellow,td.m-blue{border-top-left-radius:12px;border-top-right-radius:12px}td.m-red{background:#C73C3B}td.m-green{background:#3DB010}td.m-yellow{background:#CFA505}td.m-blue{background:#45A4D1}</style></html><body><div id="root"></div><script type="text/javascript">(function() {
